  constructor(el){
    this.el = el;
    this.chars = '✈_�_ガ_オ\u034f\u034f\u034f\u034f\u034f\u034f\u034f\u034f\u034f\u034f';

    this.queue = [];
    for(let i = 0;i<length;i++){

      const to  = newText[i] || '';

      const end = Math.floor(Math.random()*50) + start;
      this.queue.push({from,to,start,end});
    }
    
    cancelAnimationFrame(this.frameRequest);
    this.frame = 0;
    this.update();
    return promise;
  }
  
  update(){
    let output = '';
    let complete = 0;
    for(let i=0,n=this.queue.length;i<n;i++){
      let {from,to,start,end,char} = this.queue[i];
      
      if(this.frame >= end){
        complete++

        if(!char || Math.random() < 0.01){char = this.randomChar();this.queue[i].char = char;}

        output += from;

    if(complete === this.queue.length){
this.resolve();
}else{
      this.frameRequest = requestAnimationFrame(this.update);this.frame++;}
  }
  
  randomChar(){
    return this.chars[Math.floor(Math.random() * this.chars.length)].replaceAll("�","🍩")
  }
}
